import React from 'react';
  
const BusinessProvider = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
    >
      <h1>Welcome to business provider</h1>
    </div>
  );
};
  
export default BusinessProvider;
